import React from 'react';

const Contact = () => {
  const buttonStyle = {
    display: 'inline-block',
    padding: '12px 24px',
    backgroundColor: '#004ba0',
    color: 'white',
    textDecoration: 'none',
    fontSize: '1.1rem',
    fontWeight: 'bold',
    borderRadius: '30px',
    border: '2px solid transparent',
    transition: 'all 0.3s ease',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)',
    margin: '10px',
  };

  return (
    <section className="contact">
      <h2>Contact Me</h2>
      <p>Feel free to reach out to me through the following platforms:</p>
      <div className="contact-buttons">
        <a href="https://github.com/anniefees" style={buttonStyle}>GitHub</a>
        <a href="https://www.linkedin.com/in/anniefees" style={buttonStyle}>LinkedIn</a>
        <a href="mailto:feesa@mac.com" style={buttonStyle}>Email</a>
      </div>
    </section>
  );
};

export default Contact;
